import React, { Component } from "react";
import ls from "local-storage";

class MyApps extends Component {


    render() {
		return (
			<Grid item xs={12} md={9} lg={9}>
                <Paper>
                    <Table size="small">
                        <TableHead>
                            <TableRow>
                                    {/* <TableCell> 
                                        <Button 
                                            onClick={this.sortChange}>{this.renderIconSal()}
                                        </Button>
                                        Date
                                    </TableCell> */}
                                    <TableCell>Title</TableCell>
                                    <TableCell>Job-Type</TableCell>
                                    <TableCell>Recruiter</TableCell>
                                    <TableCell>
                                        <Button onClick={this.sortChangeSal}>
                                            {this.renderIconSal()}
                                        </Button>
                                        Salary
                                    </TableCell>
                                    <TableCell>
                                        <Button onClick={this.sortChangeDur}>
                                            {this.renderIconDur()}
                                        </Button>
                                        Duration
                                    </TableCell>
                                    {/* <TableCell>Rating</TableCell> */}
                                    <TableCell>Apply</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {this.state.jobs.map( (job,ind) => (
                                <TableRow key={ind}>
                                    <TableCell>{job.title}</TableCell>
                                    <TableCell>{job.jobtype}</TableCell>
                                    <TableCell>{job.rec_name}</TableCell>
                                    <TableCell>{job.salary}</TableCell>
                                    <TableCell>{job.duration}</TableCell>
                                    <TableCell>
                                        <Button onClick={() => this.handleApply(job._id)}>
                                            {/* {this.renderApplyState()} */}
                                            Apply
                                        </Button>
                                    </TableCell>
                                </TableRow>
                        ))}
                        </TableBody>
                    </Table>
                </Paper>               
            </Grid> 
		);
	}
}
export default MyApps;
